import React from 'react';
import './Projects.css';

function Projects() {
  return (
    <div className="projects">
      <h1>My Projects</h1>
      <div className="project-list">
        <section>
          <h2>Frontend Projects</h2>
          <p>Description of frontend projects here...</p>
        </section>
        <section>
          <h2>Electronics Projects</h2>
          <p>Description of electronics projects here...</p>
        </section>
      </div>
    </div>
  );
}

export default Projects;
